vector: true

script: |
  super -f text -I q2602.spq | sort > q2602.out

inputs:
  - name: q2602.spq
    data: |
      SELECT a-b
      FROM t1 (FORMAT parquet)
      WHERE (e>c OR e<d)
      AND a>b
      AND d NOT BETWEEN 110 AND 150;
  - name: t1

outputs:
  - name: q2602.out
    data: |
      1
      1
      1
      2
      2
      2
      2
      3
      3
      4
